 import React,{Fragment} from 'react';
import MainNavigation from './MainNavigation';
import classes from './Layout.module';
const Layout = () =>{
    return (
        <Fragment>
            <MainNavigation />
            <main className={classes.main}>{PaymentResponse.childern}</main>
        </Fragment>
    )
}
export default Layout;
